import React from 'react';
import '../App.css';

const About = () => (
  <div className="container">
    <h1>About HahuTech</h1>
    <p>HahuTech Solutions is a trusted IT consulting firm with expertise in data architecture, cloud solutions, and AI implementations. Our consultants bring years of experience in federal, nonprofit, and commercial sectors.</p>
  </div>
);

export default About;
